import style from "./search.module.scss";
import React from "react";

interface ISearch {
  carts: any;
}
const Search: React.FC<ISearch> = ({ event, carts }) => {
  const showSearchedCarts = () => {
    const newCardsList = carts.filter((element: any) =>
      element.name.toLowerCase().includes(event.target.value.toLowerCase())
    );
  };
  return (
    <div className={style.block}>
      <div className={style.inputBlock}>
        <img
          className={style.img}
          src={`${process.env.PUBLIC_URL}/img/loupe-search-svgrepo-com.svg`}
        />
        <input
          onChange={(e) => console.log(e.target.value)}
          className={style.input}
          placeholder="Пошук...."
        />
      </div>
      <button className={style.button}>Пошук</button>
      <div></div>
    </div>
  );
};
export default Search;
